import * as React from "react";

import { Button, Table } from "react-bootstrap";
import { useAppState } from "../../../service/AppStateContext.tsx";
import BaseService from "../../../service/base.service.tsx";
import { Customers } from "../models/diners";
import { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import { GoBack } from "../../../defultComponent/funPublik";

const Price = (priceAll) => {
    if (priceAll.priceAll) {
        return (
            <div>
                {priceAll.priceAll + "₪"}
            </div>
        )
    }
    else {
        return (
            "------"
        )
    }
}

const Status = (queue) => {
    console.log("GroupSeqNo", queue)
    if (queue === "tobesited") {
        return (
            "ממתין לשולחן"
        )
    }
    if (queue === "sit") {
        return (
            "ממתין לשירות"
        )
    }
    if (queue === "awaitingbill") {
        return (
            "ממתין לחשבון"
        )
    }
}

const MapResevation = (reservation) => {
    // let Array = [reservation]
    // reservation = JSON.stringify(reservation)
    reservation = JSON.parse(...reservation)
    // for (let i of reservation) {
    //     console.log("xx", i)
    // }
    const object = { a: 1, b: 2, c: 3 };
    console.log("reservation", typeof (reservation), typeof (object))

    for (const property in reservation) {
        console.log(`${property}: ${reservation[property]}`);
    }
    return (
        <menu className="table table-dark" >
            <thead>
                <tr >
                    <th>id</th>
                    <th>שם מנה</th>
                    <th>קטגוריה</th>
                    <th>מחיר</th>
                </tr>
            </thead>
            <tbody>
                {reservation.map((item, i) => {
                    return (
                        <tr key={i} className="align-items-center">
                            <td>{item.id}</td>
                            <td>{item.name}</td>
                            <td>{item.category}</td>
                            <td>{item.price}</td>
                        </tr>
                    )
                })}
            </tbody>
        </menu>
    )
}

const CustomersView = (props) => {
    console.log("props1111", props.item)
    let customer = props.item
    console.log("props11112", customer.id)

    return (
        <table >
            <tr >
                <td>{customer.id}</td>
                <th>id</th>
            </tr>
                <tr >
                    <td>{customer.name}</td>
                    <th>שם קבוצה</th>
                </tr>
            <tr >
                <td>{customer.size}</td>
                <th>גודל קבוצה</th>
            </tr>
            <tr >
                <td>{customer.lastUpdated}</td>
                <th>שעת הגעה</th>
            </tr>
            <tr >
                <td>{customer.table1 ?
                    <Link
                        to={"/tables/" + customer.table1}
                        className="px-1"
                        title="view">
                        <Button variant="secondary">
                            {customer.table1}
                        </Button>
                    </Link> : "מחכים לשולחן"}
                </td>
                <th>שולחן</th>
            </tr>
            <tr >
                <td>{Status(customer.queue)}</td>
                <th>סטטוס</th>
            </tr>
            <tr >
                <td><Price priceAll={customer.sum} /></td>
                <th>סך לתשלום</th>
            </tr>
            <tr >
                <td>{customer.reservations 
                // ? MapResevation(customer.reservations) : "------"
                }</td>
                <th>הזמנות</th>
            </tr>
        </table>
    )
}

export default CustomersView;
